def getIDs(entry):
	return entry[1]

def getMatches(list1,list2):
	results = []
	for element in list1:
		if element in list2:
			results.append(element)
	return results

def getConnections(data):
	results = []

	for startIndex in range(0,10):
		
		"""gets first name and creates a label"""
		name = data[startIndex][0]
		list1 = getIDs(data[startIndex])

		"""Cycles through remaining names to find connections"""
		for i in range(startIndex+1,10):
			label = [name]
			label.append(data[i][0])
			
			tempResults = []
			tempResults.append(getMatches(list1,getIDs(data[i])))
			
			"""adds result container to main list"""
			newResult = [label,tempResults]
			results.append(newResult)

	return results
	

